  $y\leq  z$ if and only if
  \begin {tikzcd}
    y\ar [r, hook]\ar [dr, "\exists "', hook] & x \\
    & z\ar [u, hook]\makebox [0pt][l]{.}
  \end {tikzcd}


 We often prefer to think of subobjects as equivalence classes of such
monomorphisms, hence as a poset.

